import React from "react";
import './Add.css';
function Add(){
    const date = new Date();

let day = date.getDate();
let month = date.getMonth()+1;
let year = date.getFullYear();


let currentDate = year+'-'+month+'-'+day;
console.log(currentDate);

    return(
        <div className="add_mainlayout">
            <div className="innerlayout">
            <form >
            <h1 style>ADD</h1>
               <div className="addcontent">

                <div className="part1">
                    <label>email</label>
                    <div><label>Firstname</label></div>
                    <div><label>Lastname</label></div>
                    <div><label>Mobilenumber</label></div>
                    <div><label>Date of Birth</label></div>
                    <div><label>Address</label></div>
                </div>
                <div className="part2">
                    <input type="text" placeholder="email"/>
                    <div><input type="text" placeholder="firstname"/></div>
                    <div><input type="text" placeholder="lastname"/></div>
                    <div><input type="number" placeholder="mobilenumber"/></div>
                    <div><input type="date" min="1980-01-01" max='currentDate'/></div>
                    <div><textarea type="text" /></div>
                </div>

                </div>
                <div><input type="submit"/></div>
            </form>
            </div>
        </div>
    )
}
export default Add;
